import React, { useState } from 'react'
import ''

function Multi() {

    const [text, setText] = useState('')


    const multiplication = () => {
        setText(Number(text) * 5)
    }
    return (
        <div>
            <h1>{text}</h1>
            <input type="text" placeholder='Enter Value' value={text} onChange={(e) => setText(e.target.value)} />
            <button onClick={multiplication}>Count</button>
        </div>
    );
}

export default Multi;
